import WolverineTemplate from '../scripts/templates/invoices/wolverine.js';
import shopService from './shop';

export default {
  printInvoice (invoicePayload) {
    // generic logo for shop that doesn't have one
    let shopLogo = 'data:image/png;base64,';

    const shopId = localStorage.getItem('shop_id');
    shopService.getShopLogo(shopId)
    .then((response) => {
      shopLogo = response.data.image;
      const template = new WolverineTemplate(shopLogo, invoicePayload);
      pdfMake.createPdf(template.getTemplate()).print();
    })
    .catch((err) => {
      console.log(err);
      if (err.status == 404) {
        // the user doesn't have a logo yet.
        // We use the generic one.
        const template = new WolverineTemplate(shopLogo, invoicePayload);
        pdfMake.createPdf(template.getTemplate()).print();
      }
    })
  }
};
